import Header from "./components/01_Header";
import MainBanner from "./components/02_MainBanner";
import SubBanner from "./components/03_SubBanner";
import AdBanner from "./components/04_AdBanner";
import FootNote from "./components/05_FootNote";
import FootNav from "./components/06_FootNav";
import FooterBottom from "./components/07_FooterBottom";
import "./App.css"


const App = () => {
    return (
        <div className="main">
            <Header />
            <MainBanner />
            <SubBanner />
            <AdBanner />
            <FootNote />
            <FootNav />
            <FooterBottom />
        </div>

    )
}






export default App
